import React from 'react';
import Header from '../../components/Header/Header';
import Togglebutton from '../../components/Togglebutton/Togglebutton';

function Main(){
    
    return(
        <div>
            {/* next Container */}
            <Header/>
            <Togglebutton/>
            <div className = "container resultcontainer"  id="resulttab">
                <div className = "row">
                        <div className = 'col-6 ' >
                            <h1>Today's Weather!</h1>
                            {/* <u className = "content">Location:</u>
                            <h3 className = "locat inlin" "></h3></br></br>
                            <u className = "content">Current Temperature:</u><h3 className = "curr_temp inlin" "></h3></br></br>
                            <u className = "content">Humidity:</u><h3 className = "hum inlin" "></h3></br></br>
                            <u className = "content">Description:</u><h3 className = "ppt inlin" "></h3></br> */}
                    
                            <form className = "check">
                                <button type="submit" className="btn btn-primary" id = "back">  Back  </button>
                            </form>
                            
                        </div>
                        {/* <div className = "col-6" id="ig">
                            
                        </div> */}
                </div>
            </div>
        </div>
    )
}
export default Main;
